import React, {useState} from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Avatar from '@material-ui/core/Avatar';
import './css/About.css';
import Typography from '@material-ui/core/Typography';
import {withStyles, createStyles} from '@material-ui/styles';
import Navigation from './navigation';
import Contact from './contact';
import StyledProps from './StyledProps';
import nateshim from './static/nateshim.png';
import {WindupChildren, Pace} from 'windups';
import AOS from 'aos';
import 'aos/dist/aos.css';
import {useSpring, animated as a} from 'react-spring';

const About = (props: StyledProps) => {
  const classes = props.classes;
  const [flipped, setFlipped] = useState(false);
  const {transform, opacity} = useSpring({
    opacity: flipped ? 1 : 0,
    transform: `perspective(600px) rotateX(${flipped ? 180 : 0}deg)`,
    config: {mass: 5, tension: 500, friction: 80}
  })

  AOS.init();
  return (   
    <Box className={classes.backgroundContainer}>
      <Navigation/>
      <Container className={classes.section} maxWidth={false}>
        <WindupChildren>
          <span className={classes.bigText}>
            <Pace ms={85}>{"        hello."}</Pace>
          </span>
        </WindupChildren>
      </Container>
      <Container className={classes.bio} maxWidth={false}>
        <Box display={{xs: 'block', sm: 'flex', md: 'flex', lg: 'flex'}}>
          <Avatar data-aos="fade-right" data-aos-delay='300' data-aos-duration='1000' src={nateshim} className={classes.avatar}/>
          <Box data-aos="fade-left" data-aos-delay='300' data-aos-duration='1000' style={{backgroundColor: '#F7F3F2'}}>
            <Container style={{padding: '4rem'}}>
              <Typography variant="subtitle1" className={classes.text}>I am a web developer currently based in the Bay Area who loves to create and collaborate with others in producing user friendly software. When I'm not sitting at my desktop, I'm usually making music, jotting down pixels, or hanging out with friends.</Typography>
            </Container>
          </Box>
        </Box>
      </Container>
      <Box>
        <Container className={classes.recentWork}>
          <Typography className={classes.recentWorkTitle}>Recent Work</Typography>
          <Box onClick={() => setFlipped(state => !state)}>
            <a.div className={classes.back} style={{opacity: opacity.interpolate(o => o), transform}}/>
            <a.div className={classes.front} style={{opacity, transform: transform.interpolate(t => `${t} rotateX(180deg)`)}}/>
          </Box>
        </Container>
      </Box>
      <Contact/>
    </Box> 
  );
}

const useStyles = createStyles({
  section: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#F7F3F2',
    alignItems: 'center',
    padding: '15rem 0',

  },
  bio: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#FEB954',
    alignItems: 'center',
    padding: '10rem 0',
  },
  text: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '1.5rem',
    textAlign: 'center',
    padding: '2rem',
  },
  bigText: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '4rem',
    textAlign: 'center',
    paddingBottom: '15rem',
    fontWeight: 'bold',
  },
  recentWorkTitle: {
    fontFamily: 'Montserrat',
    color: '#12130F',
    fontSize: '3rem',
    padding: '2rem',
  },
  recentWork: {
    alignItems: 'center',
    justifyContent: 'center',
    display: 'flex',
  },
  backgroundContainer: {
    backgroundSize: 'cover',
    height: '100%',
    width: '100%',
    backgroundColor: '#F7F3F2',
    backgroundPosition: 'center',
  },
  avatar: {
    height: '300px',
    width: '300px',
    marginRight: '3rem',
  },
  back: {
    backgroundImage: 'https://images.unsplash.com/photo-1544511916-0148ccdeb877?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1901&q=80i&auto=format&fit=crop)',
  },
  front: {
    backgroundImage: 'https://images.unsplash.com/photo-1544511916-0148ccdeb877?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1901&q=80i&auto=format&fit=crop)',
  },
});

export default withStyles(useStyles)(About);
